        <div className="col-md-3 col-sm-12">
          <motion.img
            initial={{ x: -100, opacity: 0 }}
            whileInView={{ x: 0, opacity: 1 }}
            transition={{
              delay: 0.2,
              x: { type: "spring", stiffness: 60 },
              opacity: { duration: 1 },
              ease: "easeIn",
              duration: 1,
            }}
            className="img-fluid"
            src={Feature1}
            alt="Feature1"
            width="100%"
          />
        </div>
        <div className="col-md-9 col-sm-12 d-flex align-items-center">
          <motion.div
            initial={{ x: 100, opacity: 0 }}
            whileInView={{ x: 0, opacity: 1 }}
            transition={{
              delay: 0.2,
              x: { type: "spring", stiffness: 60 },
              opacity: { duration: 1 },
              ease: "easeIn",
              duration: 1,
            }}
            // className="card-body"
          >
            <h2 class="card-title">Customizable Organization</h2>
            <p class="card-text">
              Organize your notes your way. Create folders, add tags, and
              color-code your notes to stay organized and efficient.
            </p>
          </motion.div>
        </div>
      </div>

      <div className="row border-0 bg-warning p-5" width="100%">
        <div className="col-md-9 col-sm-12 order-mdorder-sm-2 d-flex align-items-center">
          <motion.div
            initial={{ x: 100, opacity: 0 }}
            whileInView={{ x: 0, opacity: 1 }}
            transition={{
              delay: 0.2,
              x: { type: "spring", stiffness: 60 },
              opacity: { duration: 1 },
              ease: "easeIn",
              duration: 1,
            }}
            classNane="card-body"
          >
            <h2 class="card-title">Collaboration and Sharing</h2>
            <p class="card-text">
              Work together in real-time. Collaborate on projects, share notes
