            </p>
          </motion.div>
        </div>
        <div className="col-md-3 col-sm-12 order-sm-1">
          <motion.img
            initial={{ x: -100, opacity: 0 }}
            whileInView={{ x: 0, opacity: 1 }}
            transition={{
              delay: 0.2,
              x: { type: "spring", stiffness: 60 },
              opacity: { duration: 1 },
              ease: "easeIn",
              duration: 1,
            }}
            src={Feature2}
            alt="Feature2"
            width="100%"
          />
        </div>
      </div>

      {/* <div className="row border-0 alternate-color p-5" width="100%">
