      <div className="row border-0 bg-warning p-5" width="100%">
        <div className="col-9 d-flex align-items-center">
          <motion.div
            initial={{ x: 100, opacity: 0 }}
            whileInView={{ x: 0, opacity: 1 }}
            transition={{
              delay: 0.2,
              x: { type: "spring", stiffness: 60 },
              opacity: { duration: 1 },
              ease: "easeIn",
              duration: 1,
            }}
            classNane="card-body"
          >
            <h2 class="card-title">Offline Access</h2>
            <p class="card-text">
              Never lose access to your notes. Enjoy offline access anytime,
              anywhere, whether you're traveling or have limited internet
              connectivity.
            </p>
          </motion.div>
        </div>
        <div className="col-3">
          <motion.img
            initial={{ x: -100, opacity: 0 }}
            whileInView={{ x: 0, opacity: 1 }}
            transition={{
              delay: 0.2,
              x: { type: "spring", stiffness: 60 },
              opacity: { duration: 1 },
              ease: "easeIn",
              duration: 1,
            }}
            src={Feature4}
            alt="Feature4"
            width="100%"
          />
        </div>
      </div>

      {/* <div className="row">
        <div className="bottom-section p-5 text-center">
          <h2 className="pb-3">Get the Acme Notes App</h2>
          <button className="download">Download Application</button>
